// src/components/TooltipTest.js
import React from 'react';
import { Tooltip } from 'react-tooltip';
import 'react-tooltip/dist/react-tooltip.css';

const TooltipTest = () => {
    return (
        <div>
            <p data-tip="Hello, I am a tooltip!" data-for="tooltip-1">Hover over me</p>
            <Tooltip id="tooltip-1" place="top" effect="solid">
                Hello, I am a tooltip!
            </Tooltip>
        </div>
    );
};

export default TooltipTest;
